window.bookSummaryJSON = "<p>One hot night. Three naughty best friends. What can possibly go wrong?</p> <p>When an upcoming birthday makes Caitlyn Sachs decide to seek a gift that doesn't come in a box - a no-strings hookup to finally lose her pesky virginity - there's just one problem.</p> <p>She doesn't want only one guy. She wants two.</p> <p>The men she can't pick between just happen to be her best friends and business partners, Matthew Collins and Tristan Baldwin. And both men want each other too, much to her surprise.</p> <p>Then Matt offers a shocking suggestion.</p> <p>She should lose her virginity not once, but twice. To them.</p> <p>After being kidnapped and spirited away to a remote cabin in the mountains, Cait is ready to unwrap her Christmas present - her two sinful men - over and over again.</p> <p>First time, first threesome, first time she didn't want a night to ever end.</p> <p>When the morning comes, it's all supposed to be over. But sometimes holiday hotness can lead to forever....</p> <p><b><i>Unwrapped </i></b><b>was previously published by Cari Quinn in 2011. This book has been altered and re-edited.</b></p>"; 
